INSERT INTO `articles` VALUES (4, '这是一个标题', 1, 6, '<p>&nbsp;当 <code>&lt;style&gt;</code> 标签有 <code>scoped</code> 属性时，它的 CSS 只作用于当前组件中的元素。这类似于 Shadow DOM 中的样式封装。它有一些注意事项，但不需要任何 polyfill。它通过使用 PostCSS 来实现以下转换：&nbsp;&nbsp;<br></p>', '2019-11-29 17:50:39', '2019-11-29 17:50:39');
INSERT INTO `articles` VALUES (5, '这是一篇文章', 1, 7, '<h2>&nbsp;如果你希望 <code>scoped</code> 样式中的一个选择器能够作用得“更深”，例如影响子组件，你可以使用 <code>&gt;&gt;&gt;</code> 操作符：&nbsp;&nbsp;</h2>', '2019-11-29 18:14:20', '2019-11-29 18:14:20');
